R["oh__@minaeve"]="{['Version']=1773,['TS']=1728755500,['Key']='oh__@minaeve',['eu']={[63]={['O']=19700,['C']=1.040000,['D']='The earth shook when Pyroclast invaded the snow globe, territory of Hoarfrost. The tremors interrupted a mourning of a Reachmen tribe. Quietly they crept up to the creature. Hoarfrost floated into the melted valley. A loud bang shook the icy plain as their forces collided. They quickly realized that their union meant the death of both of them. Unable to let go of each other, they have remained as close to each other as they can bear ever since but they will never be together.',['N']='When Ice met Fire ',},[19]={['O']=20008,['C']=1.036000,['D']='We\\'re celebrating christmas in a small circle. Come in and take off your shoes. Put your presents under the tree and sit down. The table is being set. Don\\'t the roast and mushroom sauce smell delicious? Ser Woof has also been given a christmas ham. After dinner, we snuggle up by the fire with warm cocoa and cookies and play a game of Foxes & Felines.\\r\\n \\r\\n \\r\\n',['N']='Cozy Christmas',},},}"
