R["oh__@nathamarath"]="{['eu']={[49]={['O']=19994,['N']='Den\\'s',['D']='Nobody will look for you here.',['C']=1.500000,},[93]={['O']=19994,['N']='Yad',['C']=1.500000,['D']='',},[20]={['O']=19994,['N']='Spells & Potions',['C']=1.500000,['D']='After only two months, word of his reputation as an alchemist had spread so well in Deshaan that he decided to buy the house he had rented and used for his daily business. It was a neat house, a typical Dunmer, made for combat advantage: it had two entrances, or exits, as the case may be, was sparsly lit and just small enough to be defended by one person. It was the perfect house for a businessman in the middle of nowhere who counted quite a few people of darker desires among his customers.',},[29]={['O']=19994,['N']='Smygi',['D']='All a mage needs.',['C']=1.500000,},[70]={['O']=19995,['N']='Kha\\'jay Qidri Museum',['C']=1.030000,['D']='With a pained meow Jo\\'Bethi looked at the dank, musty ruin he had just inherited and went to offer himself as a Khunzar-ri guide to the easier-to-steal travelers at Rimmen market until he had earned enough to return to Cropsford. Then he had a bolder idea: Why not draw Khunzar-ri\\'s life into the ruin? He had learned to create portals in Cyrodill and often used them to escape the ever same battles. He nailed a board reading “MuséUm” on the ruin\\'s door.',},[44]={['O']=19994,['N']='Assainne',['D']='Welcome to my house at the end of the world :) Make yourself at home. As a vampire I usually dine out, but there is always tea on the stove and you can pick a fresh crab apple from the garden.',['C']=1.500000,},},['Key']='oh__@nathamarath',['Version']=1773,['TS']=1727644834,}"
