R["oh__@miteitel"]="{['Version']=1773,['TS']=1727203266,['eu']={[19]={['C']=1.025000,['D']='Well equipped, compact and comfortable laboratory for a practicing Arcanist - vacant after sudden disappearance of the last owner. ',['N']='Arcanist\\'s Laborator',['O']=19990,},[36]={['C']=1.035000,['D']='A pirate hideout in a treehouse near a dormant volcano? Well, no place better to hide than the one they won’t be looking at! And may all the gods preserve us from this vent erupting ... ',['N']='Treehouse',['O']=19935,},[23]={['C']=1.014000,['D']='Welcome to the Grotto-Baths inc.! Eat, drink, relax, enjoy your stay! ',['N']='Grotto Baths inc.',['O']=19889,},[104]={['C']=1.033000,['D']='\"We are happy to announce the listing of a new house in the Anthology of Available Abodes, presenting any prying mage with this charming cottage with amazing views at the Inner Sea and a beautiful waterfall right at the doorstep! The house is well equipped for an uninterrupted  research on nature’s lap, while also providing a serene and secluded place suitable to take some rest from urban hectic (and grow some vegetables as well!)\". \\nFelande Demarie',['N']='Waterfall Cottage',['O']=19933,},[25]={['C']=1.025000,['D']='A small but comfortable refuge for mage amidst Bosmer woods, furnished in Altmer style. ',['N']='Mage\\'s Refuge',['O']=19933,},[15]={['C']=1.026000,['D']='The Antiquarian Circle is happy to present for public viewing this newly discovered site of Prince of Dusk and Dawn’s veneration - bathe in the twilight of this shrine, resembling the Moonshadow, the realm of the Queen of the Night Sky! ',['N']='Shrine to Azura',['O']=19935,},[11]={['C']=1.038000,['D']='Grim and obscure Underdark dwelling of a very devoted alchemist … ',['N']='Alchemist\\'s Lair',['O']=19889,},[28]={['C']=1.026000,['D']='Enjoy a beatiful view at the nearby lake  from the terrace of this small cabin in the High Isle style - try the stew x)))',['N']='Lake Cabin',['O']=19889,},[47]={['C']=1.020000,['D']='According to an old Ural legend, carefully collected and reworked by Pavel Bazhov, a most beautiful Stone Flower grows in the domain of the Mistress of the Copper Mountain, and those who see it start to understand the beauty of stone, but life loses all its sweetness for them. ',['N']='Stone Flower',['O']=19943,},[20]={['C']=1.012000,['D']='Ever wanted to observe an underwater scene close at hand? Then book a tour by us and enjoy the view! Just be careful with the protective glass and in case of emergency touch the globe to teleport back to the surface.',['N']='Ship wreck',['O']=19933,},[63]={['C']=1.036000,['D']='',['N']='New Life Snow Globe',['O']=19915,},},['Key']='oh__@miteitel',}"
