R["fx__eu__@salvaterre__48"]="{['TS']=1713871566,['Effects']={[1]={['SizeX']=26.456456,['SizeZ']=30,['Yaw']=0.261799,['SizeY']=30,['Y']=9000,['EffectType']=8501,['Groups']=0,['MetaData']={['title']='To my mother Neala',['message']='To my mother Neala,\\n\\nLife treated you unfairly,\\n\\nBut that never held back your love, \\n\\nBefore the Red Dust took you but spared me. \\n\\n\\n\\nWe travelled to Sadrith Mora, \\n\\nWhere I begged for aid and care,\\n\\nBut the Telvanni turned their heads and said,\\n\\n\\'Magic doesn\\'t fix the innevitable even if it causes despair\\'\\n\\n\\n\\nWe found a room for you to rest, \\n\\nWhere I whispered in your ear,\\n\\n\\'Don\\'t worry mother I will bring you back,\\n\\nEven if those around me live in fear.\\n\\n\\n\\nI stayed in Sadrith Mora to learn the arts of Life and Death,\\n\\nBut I only amount to desruption and shame,\\n\\nAnd unpeace your soul to ensure my contentment and happiness.\\n\\n\\n\\nBut I am wrong mother I know it!\\n\\nI sense it as I\\'ve unbalanced Nirn, \\n\\nAs I gaze upon your wandering spirit.\\n\\n\\n\\nI take a deep breath and make it right,\\n\\nKnowing I will loose you forever, \\n\\nUntil I myself will find the light.\\n\\n\\n\\nAs I watch your spirit wonder back to Aetherius,\\n\\nYou stop and turn to tell me,\\n\\n\\'I love you no matter what and will wait\\n\\nUntil we are re-united for eternity\\'.\\n\\n\\n\\nAnd just like that the light fades and I\\'m left alone,\\n\\nA Daughter, a Necromancer, but mostly atoned.\\n\\n',},['Roll']=0,['Id']=1002,['Z']=81261.010846,['Color']=70034,['Pitch']=4.712564,['Alpha']=1,['Contrast']=1,['X']=46599.840470,},},['Version']=1773,}"
R["fx__eu__@salvaterre__47"]="{['TS']=1713871262,['Effects']={[1]={['Alpha']=1,['Pitch']=5.497787,['Groups']=0,['Yaw']=3.228859,['Z']=84040.472477,['EffectType']=8501,['Roll']=0,['X']=83077.940155,['SizeZ']=30,['Id']=1001,['SizeY']=30,['Color']=859987,['Contrast']=1,['Y']=37057,['SizeX']=26.456456,['MetaData']={['title']='The Ruined Temple of Ancestors',['message']='During the reign of the Ayleid\\'s, they created \\'The Ten Ancestor\\'s\\' made with iron and glass. The Ten Ancestor\\'s were consisdered deities to the race and religion. The statues were kept in the The Ten Ancestor Temple, later known as the White Gold Tower. \\n\\nDuring the \\'Alessian Rebellion\\' the \\'Ancestors\\' were dispersed into various cyrilic settlements for safe keeping. Following the sacking of the White Gold Tower the Ayleid artifacts were left behind and forgotten or so many thought. \\n\\nDuring the Second Era in the years 579 and 582, two historic events occured throughout Tamriel called the \\'Planesmeld\\' and \\'The Soulburst\\'. One caused by Mannimarco the Betrayer to the Five Companions. While relighting the dragon fires for Varen Aquilarios to suceed the throne, Mannimarco open the portals for Molag Bal, weakening the ancient barriers protecting Nirn. The second, a daedric invasion across territories, dark anchors would attempt to drag Nirn out of Mundus and into Coldharbour, the realm of the daedric Prince Molag Bal. The Three Banners war only contributes through death and destruction weakening the barrier of Nirn and the realms beyond. \\n\\nIt was during this time no one knows specifically one of the Temples holding an Ancestor was portaled to Coldharbour, to an isolated location waiting to be found, where to this day it has stayed in peace and destruction, while nature takes victory on the Alyeid structures. \\n\\n',},},},['Version']=1773,}"
