R["fx__na__@amandalubyk__55"]="{['Version']=1771,['TS']=1678548384,['Effects']={[1]={['SizeZ']=90,['MetaData']={['title']='SV Good Hope',['message']='PC/NA  @AmandaLubyk\\nThe Orbservatory Prior\\nby @AmandaLubyk & @researchmonkey\\n\\nWelcome pilgrim!\\n\\nBefore you rests the Space Vessel Good Hope, sent out into the great void long ago by the ancient inhabitants of this world!  Its mission: to discover all manner of science and ecology from across the galaxy. Its great hope: that what would be found could cure this world of its toxic air and poisoned water, and return life to its surface once again.\\n\\nFor many decades it voyaged, collecting all it encountered, leaving no new phenomenon undiscovered, un-sampled, untested.  Eventually it turned its course towards home, its vast Bio-dome was filled with the exotic, the unexpected, the unexplained.\\n\\nBut no hero\\'s welcome met their return.  Like the crew of the Good Hope itself, the humans of this world had died out decades before; poisoned by the hand of their own industry. Their gaze ever towards the heavens.  Their hope ever that the solution to their problems would be delivered to them.  None had taken up the task themselves.  None had acted to repair their world.\\n\\nOnly we, the Servitors, remain; dedicated to our instructions as laid down by our creators. We are the inheritors of this dead world, and so we shall go forth into the land and multiply our kind.  For what need of breathable air or drinkable water do we have. All that was left shall be reforged. We shall write our own instructions. We shall build our own new world.\\n\\nThis aged vessel and it\\'s bio-dome shall be maintained as a memorial to both the ambition and foolishness of our mortal creators.\\n\\nOh foolish mortals, look not to the Heavens for answers which you already hold in your hands.\\n\\n- End of File',},['Y']=50468,['SizeX']=66.456456,['SizeY']=90,['Id']=1001,['Color']=153961,['EffectType']=8501,['Pitch']=5.497787,['Alpha']=1,['Contrast']=3.630000,['X']=55266.567672,['Groups']=1,['Z']=104270.020699,['Roll']=0,['Yaw']=0.478220,},},}"
