R["fx__na__@crimson-3ye__83"]="{['Effects']={[1]={['Pitch']=4.712564,['SizeZ']=270,['Id']=1034,['Contrast']=4,['Alpha']=0,['Color']=888899,['MetaData']={['title']='magical glow',['message']='A cold current of energy chills you to the bone.  The air here feels strangely still, almost as if a vacuum existed just in this space.  You can feel the magicka within your bones itching to be released, as if something is calling to it...',},['EffectType']=8503,['Z']=60257.556511,['Yaw']=1.780236,['X']=21517.742587,['SizeX']=666.456456,['SizeY']=270,['Y']=32049,['Roll']=0,['Groups']=0,},[2]={['Pitch']=4.712564,['SizeZ']=210,['Id']=1035,['Contrast']=3.960000,['Alpha']=0,['Color']=999999,['MetaData']={['title']='scratches in floor',['message']='Large scuff marks cut about 4 inches deep into the stone floor.  Something heavy once sat here... it clearly moved itself or has been moved.',},['EffectType']=8503,['Z']=64252.533722,['Yaw']=0.205949,['X']=20649.432905,['SizeX']=246.456456,['SizeY']=210,['Y']=32569,['Roll']=0,['Groups']=0,},[3]={['Pitch']=0,['SizeZ']=270,['Id']=1036,['Contrast']=4,['Alpha']=0,['Color']=929299,['MetaData']={['title']='metal duct',['message']='The ductwork here appears to be relatively cool to the touch with only faint vibrations coming from it.  It almost feels hollow even in the higher parts towards the ceiling.  It may prove useful if the inside of it were accessible.',},['EffectType']=8503,['Z']=66627.985583,['Yaw']=3.377212,['X']=19933.916152,['SizeX']=246.456456,['SizeY']=270,['Y']=32813,['Roll']=0,['Groups']=0,},[4]={['Pitch']=4.712564,['SizeZ']=570,['Id']=1037,['Contrast']=4,['Alpha']=0,['Color']=959997,['MetaData']={['title']='shifting rocks',['message']='Keeping your balance is a challenge here.  The nearby machinery actively hums with life that constantly shakes the ground nearby.  It\\'s pulling something from the ground itself... a slow constant ground rattling siphon that causes loose stones to faintly dance across its surface.',},['EffectType']=8503,['Z']=64211.353994,['Yaw']=0.172788,['X']=19257.085854,['SizeX']=606.456456,['SizeY']=570,['Y']=32598,['Roll']=0,['Groups']=0,},[5]={['Pitch']=0,['SizeZ']=310,['Id']=1038,['Contrast']=4,['Alpha']=0,['Color']=939996,['MetaData']={['title']='fancy scroll',['message']='Amongst various archival drawings and what appear to be general city plans, you find a singular scroll sealed within a golden sleeve adorned with sapphires on each end.  A singular piece of parchment lies inside with a well sketched picture of a Dwemer city enveloped in green flame and lines of Dwemer script below it.  Your Dwemer is fairly strong, but this dialect appears mostly foreign to you.  However, you are able to discern a singular phrase adorning the base of the drawing: \"The Great Aetherium Fires of Irkngthand\".',},['EffectType']=8503,['Z']=61283.741548,['Yaw']=0.183260,['X']=17527.383142,['SizeX']=166.456456,['SizeY']=310,['Y']=33161,['Roll']=0,['Groups']=0,},[6]={['Pitch']=0,['SizeZ']=370,['Id']=1039,['Contrast']=4,['Alpha']=0.010000,['Color']=999097,['MetaData']={['title']='dwemer door',['message']='This door appears firmly sealed shut.  Above it reads the title \"Provisioning Hold\" in ancient Dwemer.',},['EffectType']=8503,['Z']=64895.148518,['Yaw']=3.340560,['X']=26533.381669,['SizeX']=206.456456,['SizeY']=370,['Y']=50955,['Roll']=0,['Groups']=0,},[7]={['Pitch']=0,['SizeZ']=90,['Id']=1040,['Contrast']=4,['Alpha']=0,['Color']=999093,['MetaData']={['title']='stone furnace',['message']='The cold stone exterior of this apparatus masks any activity within very well, but upon further inspection the metal brackets holding its parts together are hot to the touch.  A faint noise of boiling can be heard within ever so faintly.',},['EffectType']=8503,['Z']=63788.335762,['Yaw']=4.989896,['X']=27167.236674,['SizeX']=146.456456,['SizeY']=90,['Y']=50855,['Roll']=0,['Groups']=0,},[8]={['Pitch']=0,['SizeZ']=450,['Id']=1041,['Contrast']=4,['Alpha']=0,['Color']=959399,['MetaData']={['title']='blocked door',['message']='Large chunks of broken rocks appear to block the doorway ahead.  It\\'s strange though... their otherwise jagged surface appears melted down to a smooth sheen... so smooth it almost looks intentional.  Pieces of melted metal jut in and out of the rock pile.  The door, while mostly buried, appears unscathed and melted...',},['EffectType']=8503,['Z']=60803.229656,['Yaw']=5.752605,['X']=25378.824839,['SizeX']=326.456456,['SizeY']=450,['Y']=50926,['Roll']=0,['Groups']=0,},[9]={['Pitch']=0,['SizeZ']=450,['Id']=1042,['Contrast']=4,['Alpha']=0,['Color']=999297,['MetaData']={['title']='green flames',['message']='The heat of the green flames can be felt throughout this entire cavern.  Constant and unfaltering you can occasionally see a golden glint from within their base, though you dare not get close enough to look further.  The air immediately around each flame feels oppressive with an almost palpable taste of mineral that burns as you inhale even the smallest amount of it.',},['EffectType']=8503,['Z']=61012.916950,['Yaw']=5.784021,['X']=32970.117611,['SizeX']=306.456456,['SizeY']=450,['Y']=44025,['Roll']=0,['Groups']=0,},[10]={['Pitch']=4.799655,['SizeZ']=430,['Id']=1043,['Contrast']=4,['Alpha']=0,['Color']=999297,['MetaData']={['title']='green flames',['message']='The heat of the green flames can be felt throughout this entire cavern.  Constant and unfaltering you can occasionally see a golden glint from within their base, though you dare not get close enough to look further.  The air immediately around each flame feels oppressive with an almost palpable taste of mineral that burns as you inhale even the smallest amount of it.',},['EffectType']=8503,['Z']=61392.274260,['Yaw']=5.784021,['X']=34726.422334,['SizeX']=406.456456,['SizeY']=430,['Y']=44105,['Roll']=0,['Groups']=0,},[11]={['Pitch']=4.799655,['SizeZ']=430,['Id']=1044,['Contrast']=4,['Alpha']=0,['Color']=999297,['MetaData']={['title']='green flames',['message']='The heat of the green flames can be felt throughout this entire cavern.  Constant and unfaltering you can occasionally see a golden glint from within their base, though you dare not get close enough to look further.  The air immediately around each flame feels oppressive with an almost palpable taste of mineral that burns as you inhale even the smallest amount of it.',},['EffectType']=8503,['Z']=62733.307514,['Yaw']=5.784021,['X']=33502.631126,['SizeX']=406.456456,['SizeY']=430,['Y']=43865,['Roll']=0,['Groups']=0,},[12]={['Pitch']=0,['SizeZ']=350,['Id']=1045,['Contrast']=4,['Alpha']=0,['Color']=919599,['MetaData']={['title']='scratched rock',['message']='Claw marks from various creatures and machines mar this particular rock face.  Perhaps you were not the only being in need of an exit from the cavern floor below.  This surface does however seem very climbable.',},['EffectType']=8503,['Z']=63427.385252,['Yaw']=1.923353,['X']=32296.767384,['SizeX']=286.456456,['SizeY']=350,['Y']=44210,['Roll']=0,['Groups']=0,},[13]={['Pitch']=4.712564,['SizeZ']=370,['Id']=1046,['Contrast']=4,['Alpha']=0,['Color']=968999,['MetaData']={['title']='circular markings',['message']='Circular scratches carve about an inch into the center of this platform.  Something heavy sat here for a very long time...',},['EffectType']=8503,['Z']=64062.897800,['Yaw']=0.991347,['X']=30965.584669,['SizeX']=466.456456,['SizeY']=370,['Y']=45780,['Roll']=0,['Groups']=0,},[14]={['Pitch']=0,['SizeZ']=550,['Id']=1047,['Contrast']=4,['Alpha']=0,['Color']=959799,['MetaData']={['title']='large metal door',['message']='This heavy set door could easily crush you were it to fall over... both to your fortune and displeasure it appears firmly sealed shut.  This could take a whole team just to begin budging it.',},['EffectType']=8503,['Z']=59024.083895,['Yaw']=6.094690,['X']=32976.864248,['SizeX']=506.456456,['SizeY']=550,['Y']=46884,['Roll']=0,['Groups']=0,},[15]={['Pitch']=0,['SizeZ']=410,['Id']=1048,['Contrast']=4,['Alpha']=0,['Color']=868899,['MetaData']={['title']='skyshard noise maker',['message']='Strange clicking and skittering noises emerge from this device.  The sounds appear almost creature-like, as if some large netch were wandering about the cavern and making a ruckus in its wake.',},['EffectType']=8503,['Z']=60574.374662,['Yaw']=1.836086,['X']=30593.935253,['SizeX']=326.456456,['SizeY']=410,['Y']=46971,['Roll']=0,['Groups']=0,},[16]={['Pitch']=4.712564,['SizeZ']=242,['Id']=1049,['Contrast']=4,['Alpha']=0,['Color']=979299,['MetaData']={['title']='open duct',['message']='A current of cool air flows from the duct below.  It clearly connects somewhere beyond the inside of a machine, but the covering for it appears to be missing.',},['EffectType']=8503,['Z']=61059.513954,['Yaw']=3.398156,['X']=31620.296714,['SizeX']=242,['SizeY']=242,['Y']=46749,['Roll']=0,['Groups']=0,},[17]={['Pitch']=5.672320,['SizeZ']=430,['Id']=1050,['Contrast']=4,['Alpha']=0,['Color']=929399,['MetaData']={['title']='rubble',['message']='Rubble from a cave-in freshly lies about this chamber.  Based on the glyphs and markings on the pillars this appears to have been a meeting hall of sorts.  Dwemer symbols line the golden gilded walls and small pieces of broken dining ware lay partially buried beneath the rubble.',},['EffectType']=8503,['Z']=59236.760391,['Yaw']=5.663593,['X']=27287.416242,['SizeX']=1446.456456,['SizeY']=430,['Y']=49248,['Roll']=0,['Groups']=0,},[18]={['Pitch']=0,['SizeZ']=430,['Id']=1051,['Contrast']=4,['Alpha']=0,['Color']=899399,['MetaData']={['title']='active machine',['message']='Shock pulses through your veins after contact with either apparatus.  Faint clanking noises can be heard within as if something were actively in a tumbler.  Something else fills you with unease... like the device is watching you, though nothing seems to turn or visually suggest so.',},['EffectType']=8503,['Z']=64665.433745,['Yaw']=3.340560,['X']=28637.750326,['SizeX']=626.456456,['SizeY']=430,['Y']=49607,['Roll']=0,['Groups']=0,},[19]={['Pitch']=0,['SizeZ']=1230,['Id']=1052,['Contrast']=4,['Alpha']=0,['Color']=929299,['MetaData']={['title']='crystal spire',['message']='Strange crystals swirl about these statues.  Their magical levitation feels almost rhythmic and routine.  Oddly enough they seem to actively avoid contact with you every time you reach to touch one and a faint smell of sulfur lurks in the air around them.',},['EffectType']=8503,['Z']=63860.459480,['Yaw']=0.267035,['X']=23124.803877,['SizeX']=226.456456,['SizeY']=1230,['Y']=32402,['Roll']=0,['Groups']=0,},[20]={['Pitch']=0,['SizeZ']=1230,['Id']=1053,['Contrast']=4,['Alpha']=0,['Color']=929299,['MetaData']={['title']='crystal spire',['message']='Strange crystals swirl about these statues.  Their magical levitation feels almost rhythmic and routine.  Oddly enough they seem to actively avoid contact with you every time you reach to touch one and a faint smell of sulfur lurks in the air around them.',},['EffectType']=8503,['Z']=65951.296539,['Yaw']=0.267035,['X']=23539.303685,['SizeX']=226.456456,['SizeY']=1230,['Y']=32402,['Roll']=0,['Groups']=0,},[21]={['Pitch']=0,['SizeZ']=870,['Id']=1054,['Contrast']=4,['Alpha']=0,['Color']=888899,['MetaData']={['title']='dwemer power source',['message']='The belly of the machine appears to actively be whirling with life.  Suspending in a field of radiant electrical energy hovers a small orb of greenish black energy- pure void, motionless and still.  Whatever construction this may be it clearly holds immense power, and as you delightfully look over your finding a sudden horror of realization hits you.  Back at the base of operations another crew is excavating below a large orb that appears very similar to this one...  They are in for a potentially fatal revelation should this collapse on them.  You need to warn them!  \\n\\n\\n*Take the portal to return to base and continue the adventure in chapter 2!\\n',},['EffectType']=8503,['Z']=67994.121885,['Yaw']=3.984587,['X']=27396.368425,['SizeX']=146.456456,['SizeY']=870,['Y']=48492,['Roll']=0,['Groups']=0,},[22]={['Pitch']=0,['Y']=48339,['Id']=1055,['Roll']=0,['Color']=999999,['Contrast']=1,['EffectType']=4581,['Z']=68902.590061,['Yaw']=2.736676,['X']=27872.326147,['SizeX']=600,['SizeY']=600,['SizeZ']=600,['Alpha']=1,['Groups']=0,},},['TS']=1666942474,['Version']=1769,}"
