R["oh__@davenwolf443"]="{['Version']=1769,['TS']=1658476243,['Key']='oh__@davenwolf443',['na']={[30]={['N']='Riften House',['C']=1.051000,['O']=19195,['D']='Nothing like coming home after a hard days adventuring to a warm house with a fully stocked larder and a roaring fire. \\nI tired to make this build look like someone really lives here. \\nHope you enjoy :)',},},}"
R["fx__na__@merryjanethehighelf__11"]="{['TS']=1658069822,['Effects']={[1]={['Z']=57030.752201,['Roll']=0,['Contrast']=1,['X']=48117.280783,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=5.375614,['MetaData']={['message']='\\nTwas the mourning after a gathering of shadowy characters. All gathered had recreationally poisoned themselves in merriment. They continued to do so after the sun rose. But slowly it dawned on them: someone was missing from the after-after party.\\n\\nThe mime; presently very dead. Just inside the giant keg in the kitchen, that also held a secret staircase for emergency escapes from very drunken social awkwardness. Only one guest seemed to miss the mime much, and she was seemingly unaware of his demise. \\n\\nYou have been called to investigate the situation. If there is a reward, it will be forgiveness for an absolutely embarrassing mistake that happened a few days ago. Since then, you have done nothing but lay low--in taverns. You are hungover, and hungry.\\n\\nThough after a summons, you find yourself encouraged to saunter onwards. You find the house in an argonian village days away, but you use a wayshrine and make it there momentarily. You find the villagers annoying and nothing they have to eat looks good. You wish you could go back to the tavern inn and order food to be delivered in bed. But you do your job instead.\\n\\nAs you enter the home, you are surprised by the layout. It is deceiving from the outside. You briskly walk up the stairs. And find a kitchen to your right. It smells like grilled sweetrolls, and a mysterious smoky meat.\\n',['name']='Murder Mystery Home',},['Y']=10134,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1049,},[2]={['Z']=57511.445509,['Roll']=0,['Contrast']=1,['X']=49482.643689,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=4.272566,['MetaData']={['message']='\\nSereyne: \"This one does not remember anything after drinking that keg last night. What smells good?\" She yawns, then takes a nap; wakes up; eats a little. You exchange a cold stare before she drinks a bottle of poison. In one breath. \"This one is having poison with breakfast, and also just now with brunch. Care to join?\" \\n\\nYou decline and investigate the keg.\\n\\nThere is a crispy corpse half inside. You can see a mangled hand, and burnt legs. Toes look good.\\n\\nYou feel disturbed and leave. ',['name']='...',},['Y']=11117,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1050,},[3]={['Z']=55483.356656,['Roll']=0,['Contrast']=1,['X']=52417.456250,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=5.232497,['MetaData']={['message']='\\nYou find a narrow hallway. A nervous looking woman waits.\\n\\nNuzhime the merchant: \"Oh, get going, now! I am waiting for that handsome mime guest. He told me that he would give me a private show!\"\\n\\nYou ask if she has seen his burnt corpse in the keg, and she cries. You move on.\\n\\n',['name']='...',},['Y']=11181,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1051,},[4]={['Z']=54695.091728,['Roll']=0,['Contrast']=1,['X']=51539.843124,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=0.884882,['MetaData']={['message']='\\nA nice bedroom, full of interesting things. Bored, you move on.\\n\\n',['name']='...',},['Y']=11179,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1052,},[5]={['Z']=54361.658226,['Roll']=0,['Contrast']=1,['X']=51298.287282,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=0.130900,['MetaData']={['message']='\\nA one-legged smuggler wears her leathers in the hot tub. \"What?\" she growls.\\n\\nYou move on.\\n\\n',['name']='...',},['Y']=12238,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1053,},[6]={['Z']=54223.282373,['Roll']=0,['Contrast']=1,['X']=50470.408585,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=1.216494,['MetaData']={['message']='\\nLovely arboretum. A shifty beggar is nervously fidgeting in the corner. Is she praying? Or is she repenting? She begs you for garbage to eat. You oblige. Feeling lighter, you move on.',['name']='...',},['Y']=12272,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1054,},[7]={['Z']=54950.583438,['Roll']=0,['Contrast']=1,['X']=49391.104794,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=5.766568,['MetaData']={['message']='\\nYou find Maiq to be very talkative. You think he is a nice guy. You move on.',['name']='...',},['Y']=11180,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1055,},[8]={['Z']=55485.030939,['Roll']=0,['Contrast']=1,['X']=48005.103850,['SizeY']=235,['Groups']=0,['Alpha']=1,['SizeZ']=235,['Yaw']=1.975713,['MetaData']={['message']='\\nIn the Library you find a candlestick. A dark elf obsessed with a text that appears to be nonsense scribbles.  A skull on the table talks. An urn leaks. Something smells intoxicating. \"Don\\'t bother me, I am on the verge!\" The dark elf scowls at you.',['name']='...',},['Y']=11152,['Color']=197999,['Pitch']=0,['SizeX']=90,['EffectType']=594,['Id']=1056,},},['Version']=1769,}"
