e\", she had insisted.\\n\\nI\\'d never explored beyond the old gate, hidden behind the flowering shrubs.  Tomik said it was safe for our daughter to play there, as there was nothing but old trees and large mushrooms.  \\n\\nThe old gate creaked as I squeezed through.   Wandering up the pathway, falling petals caressed my bare shoulders.  Knots and folds in the old trees could be mistaken for doorways.  I found myself catching lights of magenta, teal, and emerald from the corners of my eyes.  Only to vanish then reappear when I wasn\\'t prepared.  Were they teasing me? \\n\\nThe gentle wind carried soft sounds of child-like giggles.  Joyous.  Playful. \\n\\nCyrstals, like those found under Shalina\\'s pillow, glistened as sun rays reflected from their rough surface.   Satisfied that my dear daughter was not learning the ways of the thief, nor telling lies, I headed back to our cottage.  The old gate creaked it\\'s farewell as I closed it behind me.\\n\\nShalina was watching from her bedroom window as I approached the cottage.  \"Hello darling\", I waved up to her.  \\n\\n\"Mommy, my friends said you visited.\"\\n \"But mommy, for big people, they only come out at night.\"\\n',['title']='They only come out at Night',},['EffectType']=8503,['Y']=23842,['Alpha']=1,['Color']=102439,['SizeY']=30,['Id']=7659,['SizeX']=26.456456,['Groups']=0,},[19]={['Contrast']=0.680000,['X']=22994,['Pitch']=0,['SizeX']=1000,['SizeZ']=1000,['Roll']=0,['Color']=999419,['EffectType']=38,['Y']=25683,['Alpha']=0.420000,['SizeY']=1000,['Z']=57388,['Id']=7660,['Yaw']=5.244714,['Groups']=0,},[20]={['Contrast']=1,['X']=21809,['Pitch']=0,['SizeX']=500,['SizeZ']=500,['Roll']=0,['Color']=996949,['EffectType']=970,['Y']=25373,['Alpha']=1,['SizeY']=500,['Z']=63920,['Id']=7661,['Yaw']=4.647812,['Groups']=0,},[21]={['Contrast']=1,['X']=16388,['Pitch']=0,['SizeX']=500,['SizeZ']=500,['Roll']=0,['Color']=996949,['EffectType']=970,['Y']=25097,['Alpha']=1,['SizeY']=500,['Z']=64314,['Id']=7662,['Yaw']=0.900590