R["fx__na__@raenicorn__75"]="{['TS']=1647662701,['Version']=1767,['Effects']={[1]={['Alpha']=1,['Y']=15280,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1036,['EffectType']=8502,['Yaw']=1.570796,['Z']=97829.511572,['MetaData']={['title']='This is Peony',['message']='She belongs to Darzha gra-Durash. You can tell because she\\'s on the goddamn counter, and it\\'s Darzha\\'s counter. Peony is a miniature echalette. She\\'ll never grow larger than she is now, despite her unending appetite for echatere moss and snow truffles, and she\\'ll most likely never stop being a pain in the ass either. At least she\\'s cute.',},['Contrast']=1,['X']=71924.411832,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[2]={['Alpha']=1,['Y']=15158,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1037,['EffectType']=8502,['Yaw']=1.221730,['Z']=98470.370659,['MetaData']={['title']='2E 562 Part 3',['message']='The inside was warm, with walls decorated in furs and old weapons, moonlight beaming through peaked windows near the ceiling. Two doors were on either side that led to what looked like shared bedchambers. \\n\\nA great hearth waited for them at the center of the curved hall where the ceiling was highest. A hunk of meat roasted above it. There was a broad male orc in a massive black bear pelt hunched over beside the flames, turning the meat on a metal rod, his grey-green face held in a scowl. His hair was long and black, woven into a strip of dreadlocks that crested his scalp and fell behind his shoulders. A braided black beard framed his wide-set tusks. He did not look up from his task as Darzha dropped the door hide behind her and strode across the room. Irliah saw her stow the bundle of clothes and the lacquered wooden box the priestesses had taken from her in a basket high on a shelf. \\n\\n\"Sit,\" she said to Irliah, without looking back. Irliah walked forward tenderly on numb feet, her eyes fixed on the orc at the fire, and sat in front of it. The heat of the flames made her fingers prickle painfully as blood rushed back into them. \\n\\nDarzha ladled something into a bowl as she spoke over her shoulder, \"You\\'ll want to remove those boots, too, they\\'re wet and your feet will warm quicker without them.\"\\n\\nShe did as she was told. It was at this the male orc finally looked up. Darzha was striding back towards her with a bowl of warm broth and a chunk of brown bread when Irliah saw his gaze fall on her.\\n\\n\"Who\\'s this, then?\" the orc said as Darzha pushed the small meal into Irliah\\'s hands. She took it eagerly and nearly forgot them both. The bowl was warm on her frozen hands, the broth rich and gamey. Her hood slid off her head as she drank. \"Darzha...\" He straightened.',},['Contrast']=1,['X']=71274.887470,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[3]={['Alpha']=1,['Y']=15158,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1038,['EffectType']=8502,['Yaw']=1.570796,['Z']=98431.052474,['MetaData']={['title']='2E 562 Part 4',['message']='\"She\\'s not your business,\" the hearthwife said sharply. \\n\\n\"By Mauloch, where did you even find her?\"\\n\\nIrliah peered over her meal at him again. She tore a chunk of bread off with her teeth and chewed.\\n\\n\"The Temple of Ire,\" Darzha said. Something about her tone carried a meaning that softened the male orc\\'s expression. \\n\\n\"Arzog will not be pleased,\" he said with a sigh. \"He was unhappy enough when I brought Brel and the twins here.\"\\n\\nShe snorted. \"He accepted them quickly enough, didn\\'t he?\"\\n\\n\"Because he *understood*, Darz, and because I didn\\'t do it to spite him.\"\\n\\n\"My husband believes anything he doesn\\'t decide for himself is *spite*,\" she said, \"This is a favor to him and the clan. And one he can\\'t mold into a weapon. Don\\'t forget that you were once where she is now, Shog.\" Irliah saw her breathing rise in her chest and wondered if she truly did care. She felt more a stray mongrel than a young girl. \\n\\n\"I remember,\" Shog said, his voice low. He took a breath, resigned. \"Where did she come from?\"\\n\\n\"Belgra tells me she was in Bangkorai with a Dominion contingent. Her Altmer father was killed in battle with the Covenant.\" \\n\\nThe orc called Shog stood and towered even over Darzha, gazing down at Irliah on the floor. She felt as though she shrank in his shadow, flickering in the firelight. \"She\\'s small for an Altmer.\"\\n\\n\"She will grow,\" said Darzha, \"and I sense tenacity in her. Eyes like a wolf pup. Like you had when we found you.\"\\n\\n\"So I see.\" He pulled at the braid on his chin. Irliah smiled sheepishly at him and was surprised to see him smile back, warmly even. She looked down at her empty bowl.\\n\\nDarzha chuckled. \"Ugly, isn\\'t he?\" She cut a strip of meat off the slab over the fire and dropped it into her bowl, as though she really was just a lost pup. ',},['Contrast']=1,['X']=71255.200807,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[4]={['Alpha']=1,['Y']=15156,['SizeY']=30,['Roll']=0,['Pitch']=4.625123,['Id']=1039,['EffectType']=8502,['Yaw']=1.308997,['Z']=98415.226755,['MetaData']={['title']='2E 562 Part 5',['message']='Irliah ate the scrap with her hands. Turelion would have been horrified. \"Our mother used to say he was all tusk and no fury,\" Darzha continued, \"He never did grow into them.\"\\n\\nIrliah fell asleep curled up on the floor in front of the fire, huddled in Darzha\\'s hood. Darzha and Shog continued to discuss her until their voices became muddled and faded to nothing, and she tumbled into dreams of a forest. \\n\\nTurelion led her by the hand through towering trees dotted with warm amber lights, vines with bright glowing bulbs swathed across the canopy above them. Beams of daylight shimmered through the leaves shifting in the breeze and made spots of light that danced along the ground. \\n\\nTurelion was tall with pale golden skin, and hair like polished bronze braided and half tied behind his long pointed ears. His face was narrow and angular, his eyes dark and hawkish. Though his demeanor was severe, she did not feel afraid. She felt safe, even as he led her from where her mother lay dying. They walked until her village had vanished into the forest behind them, and everything grew quiet. Even the rustle of leaves stopped.\\n\\nFrom the corner of her eyes the trees seemed to twist into pillars of glistening obsidian. She squeezed her father\\'s hand with both of hers as the path before them darkened and the leaves above fell into ashes. Bones cracked beneath her feet. Hooded figures appeared ahead, eyes reflecting a sickly blue in the shadows that swirled around them. She tried to hide behind Turelion\\'s leg but he pulled her out ahead of him, and when he looked down at her she saw a face she didn\\'t recognize - sallow and white as the long straight hair that framed it. His eyes were the same pale blue as the hooded figures, the pits sunken and red with black veins webbing down his cheeks.',},['Contrast']=1,['X']=71292.777355,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[5]={['Alpha']=1,['Y']=15158,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1040,['EffectType']=8502,['Yaw']=1.570796,['Z']=98333.940404,['MetaData']={['title']='2E 562 Part 6',['message']='His purple lips curled into a grin. She felt the bones beneath her feet begin to quake. \\n\\nShe woke, terrified. She shivered and pulled her cloak tight, looking around wide-eyed at the darkness. Darzha had not bothered to move her from her spot on the floor. The fire had reduced to a low smoulder, and cold moonlight still shone through the high windows. She saw Shogrul leaning in the doorway, looking out over the stronghold. \\n\\n\"I had nightmares too, little one,\" he said without turning. \"For a long while.\" He looked over his shoulder, his angry orc brow and tusks outlined by the moonlight. Irliah clambered to her feet. \"You have nothing to fear here, elf. You are clan Arzog, at least for now. Darzha has made you a bed. You should rest well, she won\\'t waste a minute putting you to work in the morning.\"\\n\\nShe hugged herself, waiting for him to say more, and when he remained silent, shuffled away to find her bed.',},['Contrast']=1,['X']=71365.482547,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[6]={['Alpha']=1,['Y']=14634,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1041,['EffectType']=8502,['Yaw']=0,['Z']=99332.082366,['MetaData']={['title']='2E 562 Part 1',['message']='Irliah remembered very little before the day Darzha found her at the Temple of Ire. She supposed the mer they called her father probably was, as he claimed to be, but she knew him as Turelion - a stranger who came for her when her mother had been taken by the healers and not returned. They had traveled for a time, and he had been kind to her. She could not recall how she had been marked with these strange symbols either, all along her arms and back and legs, little white scars scratched into her skin.\\n\\nShe hurried to keep up with Darzha as she traversed the rugged landscape, over rocks and snow, through tall bristled trees with ice clinging to the bark. The cold air nipped at her nose and cheeks and she held her hands close to her chest. Darzha had draped a heavy pelt around her shoulders, pinned together with what looked like a massive bear claw, but she had never seen snow before she was brought to Wrothgar, and she couldn\\'t feel her toes in her worn wool shoes. \\n\\n\"Come along, little elf,\" the orc woman called over her shoulder, \"Keep up, or you\\'ll get lost in the snow. There\\'s no surviving nightfall if you fall behind.\"\\n\\nIrliah shivered and tried to walk faster, each step crunching in the snow. She was grateful at least to be away from Orsinium. Even in the Temple she couldn\\'t escape the curious stares of priests and townspeople alike. Even refugees, bandaged and bleeding, gazed at her as though she had horns. She imagined she looked as strange to them as they did to her - broadly built, with scowling faces and tusks jutting out from their lower jaw, skin the color of dried moss, or dark as the swampy pools of Valenwood. As they had walked through the city streets she had attracted more stares than ever, even though she\\'d tried to cover her ears with Darzha\\'s pelt. ',},['Contrast']=1,['X']=79172.382962,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[7]={['Alpha']=1,['Y']=14761,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1042,['EffectType']=8502,['Yaw']=3.141593,['Z']=99138.540021,['MetaData']={['title']='2E 562 Part 2',['message']='The sun had just set behind the jagged Druadach Mountains, coloring the sky in pale reds and purples when she first saw the home of Darzha\\'s clan. From where they stood she could just make out the shadow of the chief\\'s longhouse against the cliffs, and a handful of small fires glowing in the cold blue-white of the snow. Lines of smoke twisted above them. The frozen sea stretched out beside it, dark as night.\\n\\nDarzha only stopped for a moment at the top of the hill to wait for her, then started down the other side without a word. As they drew closer, Irliah could smell food roasting and hunger clawed at her stomach. Her entire body ached. They had stayed off the roads for the most part to avoid bandits, and an afternoon scrambling after Darzha through the wilderness had more than worn her out. Turelion would have carried her, or lifted her onto his horse. A pang of loneliness struck her. She felt that Darzha must still be deciding whether she belonged in Rivenspire after all. Perhaps she did, but Turelion would never find her that far away.\\n\\nShe willed her short legs to move faster, hurrying to Darzha\\'s side and clutching her cloak. Her fingers were so cold she couldn\\'t close her fist completely. \\n\\nThe orc encampment was almost too small to be called a village, but the moment they were in sight she felt eyes on her and may as well have been in Orsinium. She had learned in her short time among them that orcs were not the sort to speak in hushed tones, but with Darzha there they were forced to watch with silent suspicion. Irliah understood very little about wars and alliances but she knew enough to feel unwelcome. Even the warm glow of their fires could not warm the chill she felt in their gazes. \\n\\nShe sheltered near Darzha\\'s leg and hoped her fury was enough to stave it. ',},['Contrast']=1,['X']=75398.188670,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[8]={['Alpha']=1,['Y']=14762,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1043,['EffectType']=8502,['Yaw']=2.970550,['Z']=99134.421595,['MetaData']={['title']='2E 562 Part 2 Continued',['message']='Darzha barely seemed to notice them. Even more unnerving was how quickly the darkness had fallen in the shadow of the mountains and cliffs and towering trees around them, the ocean a yawning, endless void. The orc village had become a small pocket of light she couldn\\'t see beyond. Darzha led her up icy steps to a strange curved building that tapered on either side into the ground, like a ship overturned, one of very few structures built in stone among the similarly shaped huts of wood and thick hide they had passed on the way. Darzha pushed aside the heavy leather pelt that hung in the doorway and waited for Irliah to follow. ',},['Contrast']=1,['X']=75365.341293,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[9]={['Alpha']=1,['Y']=15250,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1044,['EffectType']=8502,['Yaw']=1.570796,['Z']=96679.444902,['MetaData']={['title']='2E 562 Prologue',['message']='Darzha gra-Durash was not bothered by the cold as she strode through the icy streets of Orsinium. Though snow had piled and melted and froze again in the cracks of the cobbled stone, she walked with the assuredness that befit a hearthwife of clan Arzog, and did not clutch her furs as the biting wind tried to pry them away. The city walls loomed around her, dark and angled as the mountains of Wrothgar beyond them, but even they could not stop the harsh winter winds. \\n\\nThe sounds of hammers on stone and wooden planks being hoisted about echoed off the ancient walls, a constant racket in the perpetual rebuilding of the ruined city. Despite this there were still a line of carts along the street where she walked, the brightly painted wagons of baandari peddlers, and the less decorated wagons of their Breton allies. Crowds of men and orcs alike pushed past each other, trading goods and gold and hauling off cratefuls of textiles or supplies for construction. She raised her chin as she passed through them and didn\\'t once have to divert her path. As was due a hearthwife, even in Orsinium. They would know her by how she was dressed, though she was still young, draped in the furs of bear and wolf, her red-copper hair tied into intricate braids that ended in a knot of loops atop her head.\\n\\nThe Temple of Ire cast a shadow over it all like a dark wave over a sea of snow and buildings like pebbles. Angular statues towered at the corners, with bevels and lines carved into the likeness of Trinimac as cleanly as if they had been cut by Dwemer machines. There were no windows, no flowing banners, no bright beacons to lead the lost traveler to the light of the pariah god. Only cold black stone, hard and real and strong and older than the city itself.',},['Contrast']=1,['X']=71639.425343,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[10]={['Alpha']=1,['Y']=15250,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1045,['EffectType']=8502,['Yaw']=3.141593,['Z']=96640.113878,['MetaData']={['title']='2E 562 Prologue Part 2',['message']='When Darzha came at last to the great wooden doors, she had barely raised her hand before the door yawned open, and a priestess of Trinimac gazed out at her, eyes bright and curious. \\n\\n\"Darzha,\" she wondered aloud, \"here on Chief Arzog\\'s business?\"\\n\\n\"On my business, Belgra,\" she said, stepping inside as the priestess shifted to let her pass. She glanced around at the cavernous hall, shadowy and silent, lit only by small gatherings of candles at the bases of several massive square pillars that reached up into the darkness. It smelled earthy and damp, as though they were in a cave and not a grand temple. There were cots and bedrolls laid out in rows where wounded and misplaced refugees lay as priests in long black robes made their way between them, gliding like phantoms, offering comforting words and bowls of warm broth. Darzha\\'s eyes lingered on these broken souls, thinking on their misfortune to be touched by the Breton king\\'s war, before turning back to the priestess Belgra.\\n\\nShe was an old orsimer, with deep lines in her face and kind eyes. A mother\\'s eyes, but she was a mother of a sort to many. Darzha had known her before the creases of her face were so deep, when Darzha herself was barely of age. It seemed only days ago she had come to this place, hiding behind her father\\'s leg as he spoke the Belgra, the day they found her orphaned brother among the survivors of a forgotten clan. Chief Durash had called the look in the whelp\\'s eyes the glare of a wolf. It was that look she had come to search for again. ',},['Contrast']=1,['X']=71556.547553,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[11]={['Alpha']=1,['Y']=15250,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1046,['EffectType']=8502,['Yaw']=2.094395,['Z']=96592.911569,['MetaData']={['title']='2E 562 Prologue Part 3',['message']='\"My husband is away fighting for the southern king,\" she said plainly, \"his other wives don\\'t think this is a problem, but as it turns out he left *their* apprentices behind. Our clan is small but I\\'ve been left to gather and cook and weave and wash alone while he drags my apprentice to the warfront.\"\\n\\n\"He honors you,\" the old woman said. \"You must have raised the boy well.\" Belgra pressed the door closed behind her and gathered her silken robes at her sides as she walked towards the rows of refugees. Darzha followed. \"I would think your clan would not approve of you coming here for a solution.\"\\n\\n\"They would be fools to disapprove. It was done once before,\" she said, \"Shogrul now bears my father\\'s name.\"\\n\\n\"Shogrul was a child of another clan,\" Belgra reminded her, eyebrows raised and shaking her head slightly. \\n\\n\"Shogrul *gro-Durash*,\" Darzha said firmly. \\n\\n\"Indeed.\" Belgra continued. \"So you\\'ve come to claim another lost pup, then.\"\\n\\n\"I\\'ve come to find an apprentice. Ideally one Chief Arzog can\\'t take as his own and drag off into battle.\"\\n\\n\"It will be a challenge, then, to find one that escapes his expectations. I imagine any capable young orc would eventually become a warrior of the clan.\"\\n\\nDarzha scowled and snorted. \"Then any young whelp will do while he\\'s away. I need hands to gather and hunt, and in turn they will be welcome to our hearth.\"\\n\\nBelgra simply nodded and continued onwards.\\n\\nThe refugees and wounded warriors hardly seemed to notice them as they passed. Many slept, others were in such misery they could only groan or weep. Some had been covered in heavy burlap, never to wake again. They would be cared for by the priests, then burned in rows at the great pyre outside the city gates.',},['Contrast']=1,['X']=71596.350933,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[12]={['Alpha']=1,['Y']=15447,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1047,['EffectType']=8502,['Yaw']=1.832596,['Z']=96447.618615,['MetaData']={['title']='2E 562 Prologue Part 4',['message']='Darzha did not let herself dwell on the dead. It recalled another memory of this place that still hurt to revisit.\\n\\nBelgra led her down a wide corridor, away from the main hall. She could still hear the whistle of the winter air in the cracks between the stones, but no light came through. The priestess took a caged candle from a rusty sconce on the wall and continued deeper into the shadows of the temple, down damp and winding steps, their footfalls echoing like stones dropped into a well. They came finally to a door, and Belgra pushed it open without pause. \\n\\nPlacing the candle on a hook inside, she called out to the fire-lit chamber, \"Line up, children.\" She clapped her hands loudly as Darzha followed inside. It was not unwelcoming. Furs had been laid out on the floor to stave off the chill. Beds with clean linens lined the walls on either side of a large crackling fire that burned in the hearth across from them. \\n\\nThere were no toys, no books or soft things to comfort them, but the orphans in the Temple of Ire were kept safe and warm and taught the old ways. They would lead good lives in the service of Trinimac, instead of dying forgotten, frozen in the wilderness of Wrothgar. But Darzha would find one today to pick herbs and hunt rabbits in the service of clan Arzog. One with the glare of a wolf.\\n\\nAnother priestess, younger than Belgra but with the same kind eyes, emerged from a doorway across the room, her robes shining in the firelight. She ushered four orc children of varying age ahead of her to the front of the room. All boys, clean as could be expected, lined up like soldiers at Belgra\\'s heel. ',},['Contrast']=1,['X']=71489.745442,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[13]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1048,['EffectType']=8502,['Yaw']=2.007129,['Z']=96414.465750,['MetaData']={['title']='2E 562 Prologue Part 5',['message']='\"This is hearthwife Darzha gra-Durash,\" Belgra announced. The children looked sheepishly among themselves. \"Clan Arzog has need of strong hands, boys. Do you know what that means?\"\\n\\nSilence. One, the smallest of them, muttered, \"No, priestess.\" Darzha felt a surge of pity. They were well behaved at least. And they would have seen terrible things before coming here. She had always wondered what Shogrul had recalled of his ruined clan, but if he had ever remembered his life before he never spoke of it. \\n\\nBelgra tilted her brow to them. \"It means one of you may serve a great clan and become a great warrior.\" They looked to their priestesses with wonder, but barely spared a glance at Darzha. They were skinny and pitiable, and would do well for her purposes, but she felt a scowl on her face. She gritted her tusks. \\n\\n\"Is this all of them?\" She said.\\n\\nBelgra folded her arms. \"What did you expect of them, gra-Durash? They will grow.\"\\n\\n\"They are fine young orcs,\" Darzha said, exasperated, \"And Chief Arzog will put spears in their hands the moment he meets them.\" It was what her father had done to Shog. \"Are there no girls?\"\\n\\nThe younger priestess glanced back but Belgra shot her a look that froze her in place. \"We\\'ve one girl,\" she said, still looking darkly at her young counterpart, \"But she is to be taken by the Breton priests of Arkay, to Shornhelm.\"\\n\\n\"What\\'s wrong with her?\" \\n\\nBelgra shook her head. \"There\\'s nothing wrong with her. Orsinium is simply no place for a high elf.\"',},['Contrast']=1,['X']=71525.910325,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[14]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1049,['EffectType']=8502,['Yaw']=2.087414,['Z']=96380.002340,['MetaData']={['title']='2E 562 Prologue Part 6',['message']='\"An Altmer?\" Darzha\\'s eyebrows raised. They were a long way from Dominion territory. She hadn\\'t seen an Altmer in Wrothgar in years, aside from the old wizard at the Mages Guild hall, and when the Count of Rivenspire had met with the clans on King Emeric\\'s behalf. It was unusual, at the very least. But Altmer were clever, and her husband would be loathe to put a weapon in a little golden-skinned hand. \\n\\nBefore she could think any more on it Darzha said, \"Let me see her.\"\\n\\nThere was a long pause. The fire crackled and the orc boys shifted uncomfortably. She would take one of them if she had to, but they looked about like deer ready to bolt at the crack of a stick beneath her boot. Belgra sighed and nodded to her young compatriot, who turned on her heel and left the room. \\n\\nWhen she returned, it took Darzha a moment to even see the child. A slight little wisp of a thing, the smallest Altmer she had ever seen. Tiny and delicate as a bird. She let out a small laugh at the sight of her, and two dark amber eyes shot in her direction, round and curious. \\n\\nDarzha grinned. \"Come here,\" she said firmly. The elf was skinny, and more pathetic in appearance than the others though she must have been at least their age, but she didn\\'t spare a single glance at the priestess before releasing her hand and approaching Darzha. \\n\\nShe stopped just ahead of the boys and dropped her hands at her sides. She was maybe around seven or eight years old, though it was difficult to tell with elves. Her hair was like dull copper, braided only to keep it neat, pointed ears barely peeking out, and eyes so dark Darzha could barely see the color of them.',},['Contrast']=1,['X']=71561.479673,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[15]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1050,['EffectType']=8502,['Yaw']=2.090904,['Z']=96347.126097,['MetaData']={['title']='2E 562 Prologue Part 7',['message']='If the girl\\'s skin was golden at all it didn\\'t show in the firelight, but she saw it was marked with scars of small strange runes, carefully cut and long since healed. The girl saw her notice and brought her hands up over her arms with a slight scowl. \\n\\nDarzha gazed down at her, waiting, but the elf simply gazed back. She blinked. \"What makes you think this is an Altmer?\" Darzha said without looking away.\\n\\nIt was the younger priestess who answered, \"The Covenant captain who found her said she was hiding in an Altmer officer\\'s tent, in Bangkorai.\"\\n\\n\"A serving girl?\" \\n\\n\"Far too young,\" Belgra said, \"Even by Aldmeri standards. It was likely the girl\\'s father.\" \\n\\nDarzha nodded. \"Strange for a mer to bring a whelp so young to a battlefront. She\\'s small for an Altmer,\" she said, mostly to herself. She looked between her and the boys behind her. \"Can you speak for yourself?\"\\n\\n\"What do you want me to say?\" She said, her voice small, but she didn\\'t seem shy. An Altmer accent, if Darzha had to place it.\\n\\n\"Tell me your name.\"\\n\\n\"The captain called me Irliah.\"\\n\\n\"What do your parents call you?\"\\n\\nFor the first time the girl looked over her shoulder at the priestess and rocked back on her heels, uncertain. Darzha thought of Shog, how he had yet to speak of his birth parents, and said, \"No, nevermind. That will do. Irliah then.\"\\n\\nThe girl looked back to her and sighed a little. Belgra put a hand gently on her head. \"They brought her by wagon only weeks ago. The redguard captain told us the mer he believes was her father was among the dead when the battle ended. She says her mother is gone as well.\"\\n\\n\"Knahaten flu,\" the other priestess added softly.\\n\\n\"And these markings?\" Said Darzha.\\n\\nBelgra shook her head. \"Elven wizardry.\"\\n\\nSuch cruelty, Darzha thought. She was silent for a pause.',},['Contrast']=1,['X']=71599.403304,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[16]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1051,['EffectType']=8502,['Yaw']=2.024582,['Z']=96314.181084,['MetaData']={['title']='2E 562 Prologue Part 8',['message']='There was no hint of sadness in the girl\\'s face. She only looked weary, and perhaps a bit feral. Darzha suspected it had been a long while since she had known the warmth of a loving family, if she ever had. \"Show me your hands\" Darzha said. Two small hands reached out, palms up. Darzha knelt, narrowed her eyes and studied her face. A pretty, delicate little elf. Arzog would not be pleased. That made her grin. \\n\\n\"Can you listen well, Irliah?\"\\n\\nShe nodded.\\n\\nBelgra began to object but Darzha rose and did not meet her eyes. She lifted her chin, as she had on her way to the Temple. \"My mind is made up, Belgra,\" she said, \"I need hands fit for gathering that my chief can\\'t push an axe into. These boys would make fine warriors. The girl is mine.\" She turned her attention back to Irliah, who watched them quietly with eyes wide and wary. \"What do you say, little elf? I\\'ve a home and hearth. You will be safe with us.\"\\n\\nIrliah looked between them, then nodded once, slowly. Darzha looked to Belgra, triumphant. \\n\\nBelgra\\'s mouth was a hard line, but she knew better than to argue with a hearthwife. She gestured to the young priestess who once again hurried off into the other room. \\n\\nDarzha lowered her chin and spoke, \"The Bretons would make her a serving girl at best. Rivenspire will not be a home to her. Clan Arzog can give her that.\"\\n\\n\"Wrothgar will be cruel to her,\" Belgra said, almost sadly.\\n\\nDarzha looked back to the girl. \"It will make her strong, then.\" \\n\\nThe priestess returned quickly with a small pile of clothing, and a lacquered box about two hands wide. It was everything left of the little elf\\'s life. Darzha took it carefully in one hand, and Irliah\\'s hand in the other. She did not know what horrors she had come from but she was clan Arzog now. A wolf pup, just as Shog was.',},['Contrast']=1,['X']=71638.048676,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[17]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1052,['EffectType']=8502,['Yaw']=3.926991,['Z']=100394.505102,['MetaData']={['title']='2E 565 Part 1',['message']='Serenna was little more than a shadow in the dark, passing deftly between the trees, her feet dancing over the earth as she stepped over fallen leaves and twigs without a sound. She stopped at the foot of the hill and leaned around the trunk of an ancient cedar tree, peering out at the orc village of clan Ubenk. \\n\\nIrliah took a single step off her granite perch and slipped on pine needles. She hit the ground with a soft thud and slid a few feet down the hill behind Serenna, who quickly glanced back at the noise and gestured at her to hide.  She scrambled to the nearest tree and pressed herself against it, grimacing. \\n\\nSerenna held a single finger to her lips and mouthed \"careful\" at her before looking back towards the village. She was pretty, a couple years older than Irliah, with long black hair caught in a tie at her shoulder, skin ashen blue like an overcast sky and a thin oval face. Her eyes were entirely red, nearly black where the whites would be were she not a dunmer. \\n\\nIrliah peeked out from behind her tree and felt her stomach flip at the thought of crossing through the village. It was early, and there were few fires to lift the cold grey light of morning. Only a few of the clan were awake to chop wood and gather and prepare for the day. It occurred to her that she would be out doing the same were she doing what she was supposed to. If they weren\\'t caught by clan Ubenk she would still have Darzha to answer to. But if they were....\\n\\nShe crouched, gripping the tree bark and watching Serenna anxiously. She was still for a long pause, surveying the distance between them and their target - the longhouse.',},['Contrast']=1,['X']=71233.815188,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[18]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1053,['EffectType']=8502,['Yaw']=4.014257,['Z']=100355.223427,['MetaData']={['title']='2E 565 Part 2',['message']='Irliah wanted to voice her uncertainty but Serenna met her eyes just as she opened her mouth to speak. She jerked her head towards the back side of a nearby tent, and hurried to hide behind it. Irliah followed, too afraid to look  at the orcs across from them. They didn\\'t even spare a glance from their work. \\n\\nThey crept closer, darting across the gaps between each hut at Serenna\\'s signal. They stopped when they reached the corner of the longhouse and ducked behind the tapered roof. The large central beam that curved along the ridge of the roof to the peak would make it easier to climb and stay hidden. Serenna peeked out at the village again to be sure they were out of earshot then sighed and turned back to Irliah. \\n\\n\"Okay, hard part\\'s over,\" she said quietly, \"well, the first hard part.\" She craned her neck to study the longhouse, looking for a way in. \"It\\'s just like ours. We\\'ll climb along the top and then slide down to the peak over the window, see it?\"\\n\\nIrliah leaned out to see around her, grasping the roof as though she might fall through the earth if she stepped too far away. She could only see the very tip of the small pointed eave over the window. \\n\\nSerenna gripped her shoulder, held up a rope in her other hand. \"I\\'ll lower you down from there, you grab the axe, tie this around your waist and I\\'ll pull you out.\"\\n\\nIrliah pressed herself to the roof again. \"What if they see me?\"\\n\\n\"They won\\'t see you, Illy,\" Serenna said, squeezing her shoulder. She lowered her head to meet her eyes. \"You can do this. Let\\'s take this s\\'wit down a peg, huh?\"',},['Contrast']=1,['X']=71194.227863,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[19]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1054,['EffectType']=8502,['Yaw']=4.101524,['Z']=100317.074730,['MetaData']={['title']='2E 565 Part 3',['message']='Irliah managed a small nervous grin and nodded. Serenna gave her one final pat on the arm, then whirled around and leapt up the lowest part of the crescent roof, kicking off the slope to grab the edge of the center beam, and once she had her footing, extended a hand to Irliah to help her follow.\\n\\nThough she had grown since she was first brought to clan Arzog she was at least a head shorter than Serenna and had to scramble over the wooden shakes to reach her. Serenna hoisted her up in one swift pull. \\n\\n\"Lucky you\\'re so light,\" she said. They sidled along the rooftop, gripping the central beam to keep from slipping down the side. Irliah felt the muscles in her forearms begin to tremble and burn. When they finally reached the point of the roof that sloped down to the window she was struggling not to fall. \\n\\nThey could see out over the village at this height, and the orcs of clan Ubenk were still hard at work, the sentry perched facing away from them. Even if they were to look this way it would be too dark for them to spot them with only their hands peeking out atop the roof. \\n\\nSerenna released her grip without hesitation and slid down to the window. She landed heavily, nearly sliding over the edge, but caught herself. After a pause she looked up to where Irliah waited hanging off the beam. She held out her hands and nodded. \\n\\nIrliah took a shaky breath, shifted her feet. She let go. As she slid down the roof she felt the shakes pass beneath her feet, her hands grasping at the rough wood to slow her fall. She might have cried out if she had any breath in her lungs, but then she landed, Serenna\\'s hands outstretched to steady her. \\n\\n\"Alright, Illy?\" Serenna said. She nodded, breathless, looking up at the curve of the roof and the moons hanging above it.',},['Contrast']=1,['X']=71158.620246,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[20]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1055,['EffectType']=8502,['Yaw']=3.839724,['Z']=100275.587156,['MetaData']={['title']='2E 565 Part 4',['message']='Smoke and the steady sound of snores drifted up out of the open window as Serenna carefully tied the rope around Irliah\\'s waist. Darzha would surely be awake by now and looking for her. She wondered if she would be pleased enough to have the axe of King Torug brought to the clan to overlook her absence. She doubted it.\\n\\nSerenna pulled the knot tight and grinned. \"You ready to do this, knife-ear?\" She said, wrinkling her nose a little at the slur. \\n\\nIrliah kicked her boot, smiling. \"Ready, Ren.\" She crawled down the eave and kicked her feet over the edge. \\n\\n\"The mantle should be just below the window,\" Serenna whispered, \"and that idiot Lugdub is asleep just to the right. If it\\'s still where we last saw it the axe is just beside his bed.\" \\n\\nIrliah nodded. \\n\\n\"Be quick, Illy.\"\\n\\nShe dropped over the side, swinging her shoes under to catch the ledge. When she was sure she could climb down she tapped the roof, and Serenna loosened her grip on the rope. \\n\\nThe inside of clan Ubenk\\'s longhouse was not much different than their own, but the chief\\'s son Lugdub had the entire left side to himself. He was a snoring lump in a bed of fur, a smoldering fire in the hearth beside him just below Irliah\\'s feet. The rest of the room was a mess. Jerkins and pants and weapons piled in the corners and were strewn across the floor. His desk was covered in dirty stone dishes and wadded up papers. She could only imagine what use an orc like Lugdub had for paper and writing. She doubted he could read at all. A practice dummy sat in the far corner from her with little cloth elf ears pinned to its head. She scowled. \\n\\nShe found her footing on the mantle and lowered herself onto the ground, unmoving as she caught her breath, staring at the lump of an orc beside her. He snorted and continued sleeping.',},['Contrast']=1,['X']=71122.693515,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[21]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1056,['EffectType']=8502,['Yaw']=3.839724,['Z']=100232.342802,['MetaData']={['title']='2E 565 Part 5 ',['message']='The axe was on the floor beneath the bed, just where it was supposed to be. \\n\\nShe scoffed silently at the sight of King Torug\\'s axe on the ground with scraps of paper and bread crumbs. They were doing this idiot a fovor, putting the axe in Arzog\\'s hands. \\n\\nIrliah knelt and crept closer, carefully wrapping each hand on the hilt and just below the blade, so it wouldn\\'t scrape along the stone floor. It was heavier than she expected, and though it was only a hand axe it was nearly half her size. As she pulled it closer she noticed one of the crumpled papers on the floor had a rough drawing on it, a figure with pointed ears, and an axe in her head. \\n\\nShe froze, blinked, and glanced up at Lugdub, who was staring blankly at her from his bed. A boy near Serenna and Revyn\\'s age, with small tusks and a black knot of hair on his dull grey head. Two black, stupid, beady eyes gazing down at her. The moment stretched on as he seemed to be deciding whether he was dreaming, and Irliah stared back, barely breathing, before tugging the rope once and being yanked by the waist toward the window. \\n\\nLugdub leapt from his bed, swinging both arms after her, swearing incoherently. He fell face-first into the floor as Irliah was pulled up over the mantle. He stumbled to his feet and caught her legs just below the knee. She barely made out the word \"knife-ear\", spat with such hatred and vitriol as he shouted obscenities at her, and she wriggled loose, kicked him once in the face, hard, and dropped the axe out the window. \\n\\nShe gripped the edge and hoisted herself out, with Serenna crouching over her gathering the rope, Lugdub groaning in pain below. They heard him calling out \"intruder\", though it was muffled behind his hands, and soon the entire village would be after them. ',},['Contrast']=1,['X']=71091.598073,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[22]={['Alpha']=1,['Y']=15448,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1057,['EffectType']=8502,['Yaw']=3.665191,['Z']=100188.848185,['MetaData']={['title']='2E 565 Part 6 ',['message']='Serenna shouted at her to \"Jump!\" and Irliah dropped out of the window. Her boots connected at an angle with the sloped roof and she tumbled down the side. She landed with a hard thud into dirt and pine needles. She groaned and sat up. Her entire right side covered in black dirt and blood trickled from her nose. She wiped it on her sleeve. Serenna slid down after her and quickly helped her to her feet, untied the rope and tossed it aside. There was shouting on the other side of the longhouse. \"Run, Irliah! Go!\" She said, pushing her away. \\n\\nIrliah hesitated, starting off into the trees as Serenna hurried to where the axe lay, but only making it a few steps before she turned and watched her nervously. Serenna slung the axe onto her back just as several figures emerged around the corner, a torch burning bright even as dawn began to break over the mountains, and she bolted into the trees, grasping Irliah\\'s arm tightly and pulling her along. \\n\\nThey ran through the forest, stumbling over stones and leaping across narrow streams, until Irliah felt her lungs burn, her legs numb, and the shouting behind them was little more than a distant echo. They rounded a jagged line of rocks along the mountainside and pressed their backs to it, panting.\\n\\nIrliah slid to the ground and let her legs splay out in front of her. Serenna dropped the axe and leaned back, laughing breathlessly. She mussed Irliah\\'s hair a little.\\n\\n\"Nice work, Illy,\" she breathed. \\n\\nIrliah let out a small laugh, still catching her breath, and said \"I can\\'t believe that worked.\" She put her palms to her head and fell back against the stone, looking up at Serenna wide-eyed, \"I think I broke his nose!\"',},['Contrast']=1,['X']=71056.118887,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[23]={['Alpha']=1,['Y']=15165,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1058,['EffectType']=8502,['Yaw']=4.712389,['Z']=100541.660067,['MetaData']={['title']='Letter to Irliah of Clan Arzog',['message']='Irliah,\\n\\nI\\'m sorry to have to tell you this again, but I have been unable to find any news of your father. \\n\\nI can tell you that after some digging I discovered a Battlereeve Turelion, but he was reported missing in action some time before you would have been traveling with him. Other records simply do not exist, or were destroyed. \\n\\nI have sent an inquiry to the Dominion to request possibly forwarding your letters to this Battlereeve, if he still lives, perhaps under another name. Until I receive a response I will keep your letter safe here with the others. \\n\\nWarm regards,\\n \\nChronicler Elenwe, College of Sapiarchs',},['Contrast']=1,['X']=71556.198250,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[24]={['Alpha']=1,['Y']=15400,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1060,['EffectType']=8502,['Yaw']=3.839724,['Z']=100443.033009,['MetaData']={['title']='2E 565 Part 7',['message']='They followed the stream downriver, assuming their pursuers would follow the roads to Forgemaster Falls where the stronghold of clan Arzog was. They would be hard to spot in the forest, and even harder to follow once they started to climb down the crags of the tall steep cliffs that surrounded the stronghold. \\n\\nThere were a few narrow paths through the cliffside Darzha had shown Irliah that made it easier to trek into the highlands for herbs that didn\\'t grow so close to the sea. In the winter they were often frozen over or hidden in heavy snowfall, but in summer they were a short steep hike in and out of the village. Irliah led Serenna down a narrow crack in the stone just beside the falls, the water thundering past them into a pool below. \\n\\nThe sun had risen over the mountains far behind them, and from up here they could see over the entire stronghold, still dormant in the early morning. White peaks crested over the dark cold sea, a gentle breeze tossing the waves against the rocky shore and swaying the branches of towering pine trees. Far beyond, across the water to the north, was the outline of Morkul Stronghold, a solemn fortress of black stone hunched over, crumbling into the sea. \\n\\nIrliah saw thin lines of smoke twisting into the air from the longhouse of clan Arzog through the trees below and was suddenly filled with dread again. \\n\\nClan Ubenk might have beaten them there. Lugdub saw her face, the only elven child in Wrothgar. They all knew of her, and to whom she belonged. Darzha would not be pleased. \\n\\nThey clambered down the narrow path, finally reaching even ground at the base of the falls, their clothes and hair damp from the constant mist of thundering freezing water.',},['Contrast']=1,['X']=71191.498700,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[25]={['Alpha']=1,['Y']=15399,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1061,['EffectType']=8502,['Yaw']=3.839724,['Z']=100399.879662,['MetaData']={['title']='2E 565 Part 8',['message']='The roar of the falls would have overwhelmed the sounds of the stronghold waking down the hill, if there was anything to be heard. It was hardly worth attempting to return stealthily at this point, anyway, since Ubenk might be on their doorstep before the morning was done. \\n\\nThe sound of rushing water faded when they came to the bottom of the hill, shivering in the shade of the trees, their feet crunching on the rocky path. It was Brelyna who saw them first.\\n\\nShe looked as though she had been pacing in front of the longhouse, wringing her slender grey-blue hands together, brow knit with worry, when she turned on her heel and lit up at the sight of them. She gathered her skirt, a plain green frock of her own making, and hurried over to them. She put a hand on each of their shoulders, touched Irliah\\'s cheek as she looked them over, dark red eyes frought with worry.\\n\\n\"Where have you been? You\\'re *soaked*. And your sleeve!\" She gasped, raising Irliah\\'s arm to study the smear of nose blood on her beige cotton jerkin. \"Is this blood?\" She looked horrified.\\n\\nSerenna brushed her mother\\'s hand away as she began to fuss over a cut on her brow. \"We\\'re fine, mum,\" she said gently. \"Just a little orc business.\" She exchanged a glance with Irliah, who suppressed a laugh. \\n\\n\"Ayem\\'s mercy, what in...\" Brelyna\\'s sharp brow creased and her eyes darkened. \"This had better not have something to do with that Ubenk boy.\"\\n\\nThe smile dropped from Irliah\\'s face in an instant, and suddenly she couldn\\'t look any higher than her own muddy shoes. Shoes Brelyna had made her, brown with pretty white embroidery along the tops, now soiled with black dirt and spots of blood that may have belonged to Lugdub.',},['Contrast']=1,['X']=71158.264464,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[26]={['Alpha']=1,['Y']=15399,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1062,['EffectType']=8502,['Yaw']=3.839724,['Z']=100353.498244,['MetaData']={['title']='2E 565 Part 9',['message']='\"They\\'re not at the river,\" a voice called from around the longhouse, Shogrul\\'s voice, deep and even, \"Darzha\\'s gone to the docks to-\"\\n\\n\"They\\'re here.\" Brelyna called back with her eyes fixed on them, as though they might slip away again. Shog had appeared far behind her. He jogged over, looking relieved, and then upon spotting the axe seemed to loom over them, scowling. \\n\\n\"You did not,\" he rumbled, daring them to say it aloud. \\n\\nSerenna bristled and stepped closer, ready to defend their actions, but Irliah heard herself speak before she could stop.\\n\\n\"He called me knife-ear.\" \\n\\nThey all paused and looked at her. She looked back to her feet and rocked back, surprised at the anger in her own voice. Ashamed, even, that she let it get to her. She met their eyes again. Brelyna looked shocked, Shogrul simply watched her, as though waiting for more. \\n\\nShe clenched her fists, feeling small and alone. It was enough reason for her. \"I would have kicked his teeth in if I could have. He\\'s lucky we only took his stupid axe.\"\\n\\n\"You may have kicked his teeth in as well,\" Serenna said, smirking.\\n\\nIrliah bit her lip, suppressing a grin, and looked down again. \\n\\nShog looked between them. \"He saw you?\"  They answered with silence. Shog only sighed. \"Inside. Now. Both of you. And give that to me.\" He nodded to the axe. Serenna groaned, but obeyed and swung it off her back. It looked smaller in Shog\\'s hands. He shook his head, then ushered them into the longhouse. Brelyna plucked a twig from Irliah\\'s hair as they walked.\\n\\nThey ducked under Shogrul\\'s muscled arm as he held aside the hide flap in the doorway.\\n',},['Contrast']=1,['X']=71120.201831,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[27]={['Alpha']=1,['Y']=15399,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1063,['EffectType']=8502,['Yaw']=3.839724,['Z']=100260.270532,['MetaData']={['title']='2E 565 Part 11',['message']='Khazha stopped laughing and stood to allow Irliah to sit in his place. He pat her on the shoulder and went to lean against the wall, well out of the way. Serenna sat beside her on the bench but Revyn stood behind them. He looked ready to argue.\\n\\nShog turned the axe in his hands for a moment, looking it over as though it was disappointing somehow. It had been handed down among clan Ubenk for so long no one knew how it had fallen into their possession, though they claimed an ancestor had won it from King Torug in a friendly competition. Or something like that. Irliah didn\\'t care much to listen to the story as Lugdub had told it at the last meeting of clans. The axe itself was unspectacular, plain iron, with the brand of a roaring snow bear on the side and a ratty braid of red string hanging off the hilt.\\n\\nShog continued to study it as he spoke. \"Clan Ubenk are our brothers, and don\\'t argue,\" he added quickly as Serenna started to speak, \"As much as you dislike the chief\\'s son, Lugdub stands to take over our clan if Chief Arzog has no heir. You can\\'t keep antagonizing the boy.\"\\n\\n\"You heard what he called Illy!\" Serenna said, fuming.\\n\\n\"I did, and I\\'m sorry for that. The boy\\'s a clod. And an arse. But that\\'s his failing,\" he met Irliah\\'s eyes, \"not yours. Don\\'t you waste a second on the ideas of a fool. You are clan Arzog and that\\'s that.\"\\n\\nIrliah slumped over with her ankles crossed and looked aside, ashamed. She wished Shog\\'s words were enough to convince her.\\n',},['Contrast']=1,['X']=71051.289893,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[28]={['Alpha']=1,['Y']=15399,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1064,['EffectType']=8502,['Yaw']=3.839724,['Z']=100307.257081,['MetaData']={['title']='2E 565 Part 10',['message']='Revyn looked up from where he sat, on a wooden stool by the hearth. He looked much like his twin sister Serenna, with an angled jaw and dark red eyes like his mother, his black hair pulled into a small ponytail, undercut at the sides. He was holding one of Shog\\'s lutes and messing with the pegs trying to get them to stick in place. He plucked the string as it slipped out of tune, a sad drooping note. Shog\\'s khajiit apprentice Ja\\'Khazha sat across from him with his legs crossed and a mug in hand.\\n\\nHis face lit with a fanged grin and he sat forward when he saw them. \"Little cubs!\" he exclaimed in a thick khajiiti accent, his voice rough and growling though he was barely twenty years old. \"Thought you\\'d been washed out to sea, or perhaps blown away in the wind.\" He chuckled and raised his spotted furry brow at Irliah.\\n\\n\"Is that ale, Khazha?\" said Brelyna, \"It\\'s six o\\'clock in the morning.\"\\n\\n\"Not it is not ale. It\\'s ale and moon sugar.\"\\n\\nRevyn had stood to meet them and touched his sister\\'s forehead where she must have scraped it running through the woods. \"Vehk, what happened to you two? You look like you lost a fight with a bush.\" He crossed his arms.\\n\\n\"Your sisters,\" Shogrul started, as though Revyn was somehow responsible, \"thought it was a good idea to steal the axe of King Torug from clan Ubenk. I assume you had nothing to do with that?\"\\n\\nRevyn\\'s eyes went wide. \"They what?\" Ja\\'Khazha started laughing.\\n\\n\"Don\\'t be coy, Revyn,\" Brelyna said sternly. \\n\\n\"Rev didn\\'t do anything,\" Irliah muttered, \"He was asleep when we left.\"\\n\\nShog sighed, pinching the bridge of his nose. \"Fine. Regardless, the three of you sit. We need to have a talk.\"\\n',},['Contrast']=1,['X']=71088.614551,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[29]={['Alpha']=1,['Y']=15399,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1065,['EffectType']=8502,['Yaw']=3.839724,['Z']=100210.655845,['MetaData']={['title']='2E 565 Part 12',['message']='\"Now look,\" Shog continued, placing the axe onto the counter where Darzha prepared meals for the day, beside a basket of brown bread as though it was scrap metal and not the weapon of a legendary orsimer warrior. \"Clan Ubenk will not take this insult lightly. When they arrive here they\\'ll want recompense, and it\\'s very likely it\\'ll be through combat, as tradition demands.\"\\n\\nSerenna snorted. \"Why don\\'t they just take the axe and fetch off?\" She gestured tersely in the vague direction of the door.\\n\\n\"It doesn\\'t work that way,\" Shog shook his head. \"Chief Guronk is old and follows the old ways. They\\'ll come with a challenge and we\\'ll be expected to meet it. Lugdub will have to reclaim the axe,\" he hesitated for a long pause, then sighed, \"which means it must be won from the hands that took it.\" His gaze fell on Irliah.\\n\\nShe straightened and looked around at the twins, then back to Shog, incredulous. \"What? Me?\"\\n\\n\"How- But that\\'s ridiculous!\" Serenna stammered, \"She\\'s a child, look at her!\"\\n\\nRevyn had come around the bench and stepped in front of her. \"She\\'s not fighting anyone. If that s\\'wit wants a fight I\\'ll give it to him.\"\\n\\nIrliah felt a shadow of indignation and a tiny scowl crossed her face. She wasn\\'t afraid of Lugdub. But she bit her tongue and it passed. They were right. She was too small to match him, as much as she wanted to add injury to insult.\\n\\n\"Guronk will not accept that,\" said Shog, \"*You* stole the axe, Irliah, so it must be reclaimed from you, if the fool\\'s dignity is to be restored.\"\\n\\n\"Dignity?\" Revyn scoffed, \"Lugdub is twice her size.\"\\n\\nBrelyna had been watching with growing concern and placed a hand gently on Shogrul\\'s arm. \"Shog, dear, there must be something.\"',},['Contrast']=1,['X']=71017.549965,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[30]={['Alpha']=1,['Y']=15359,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1066,['EffectType']=8502,['Yaw']=3.839724,['Z']=100443.033009,['MetaData']={['title']='2E 565 Part 13',['message']='\"She won\\'t be fighting anyone,\" Shog said, \"Rev had the right of that, at least. If Darzha can\\'t talk sense into Chief Guronk and convince them to leave with the axe, Irliah will yield and that\\'ll be the end of it. And that *will* be the end of it. I won\\'t hear of any of you troubling the lad again.\" He fixed them all with a firm glare, challenging them to argue. Irliah slouched and peered back timidly. Shogrul wasn\\'t often cross with her. It was uncomfortable.\\n\\nRev stood with his fists balled up at his sides and his eyes locked in an angry stare at the floor. Serenna sat pouting with her arms crossed. Neither of them spoke. \\n\\n\"Good,\" Shog said with finality, picking up the axe. \"Now the two of you get cleaned up. I\\'ll tell Darzha you\\'re back so she can put you to work.\" He lifted the hide in the front door and strode out. Brelyna followed close behind looking unsatisfied. It was likely not the end of the conversation for her.\\n\\nWhen they were both gone and well out of earshot Ja\\'Khazha hissed and said, \"Orc nonsense.\" Irliah looked back at him as he came around the bench and put a clawed hand firmly on Revyn\\'s shoulder. He leaned closer to her, golden beads clicking together in the long braided fur along his jaw. \"You are sharp and quick as an arrow, little cub, and you could strike the slow fool if you wish. Beat these silly orcs at their own game, eh?\"\\n\\n\"You think she should fight him?\" Revyn looked incredulous.\\n\\nKhazha gave a low laugh in response that sounded almost like a growl. \"I think if the little chiefling extends an invitation, it would be a wasted opportunity to not accept and put him in his place. A chance to punish his ignorance with no consequences.\"',},['Contrast']=1,['X']=71191.498700,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[31]={['Alpha']=1,['Y']=15359,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1067,['EffectType']=8502,['Yaw']=3.839724,['Z']=100398.085401,['MetaData']={['title']='2E 565 Part 14',['message']='\"Shog told me to yield,\" Irliah said.\\n\\n\"And you should,\" Khazha tapped the side of his snout, \"but perhaps you get a hit in first, yes? This is what Khazha would do.\"\\n\\nHe mussed her hair a little, and then he left too, whistling as he walked out the door.\\n\\nIrliah wanted to get more than just a hit in. She wished she was taller. Or that she had even a hint of magical talent, as Altmer were said to have. She\\'d have set Lugdubs hair aflame but she couldn\\'t produce so much as a spark.\\n\\nShe washed and changed clothes, and Darzha made sure she rinsed the blood from her jerkin with cool water before it stained. She was silent as they cleaned her mud crusted boots, but Darzha was not the type to be silent when angry. Irliah didn\\'t test it. Darzha combed and braided her shoulder length tawny hair without so much as a word about what happened, and set her to work kneading the dough she had prepared that morning in her absence. Before leaving her there to tend to other work she placed a sweetroll on the counter beside her. Irliah looked up, confused, but Darzha only shrugged as though she didn\\'t see it, with a grin so slight Irliah was convinced she had imagined it. A trick of the light.\\n\\nEvening found her on the outskirts of the village, sitting cross legged atop a large boulder where the river met the sea, eating a freshly steamed bun stuffed with crumbly lamb meat. She had slipped away while the others prepared the table for dinner. She wasn\\'t hungry, and had no interest in talking about what had happened. Or what was going to happen. Or anything.\\n\\nThe sky had dimmed to a calm violet, the horizon wreathed in soft pink clouds across the water. She could see out across the bay here, all the way to the crumbling walls of Morkul and the docks they had built around them.',},['Contrast']=1,['X']=71159.801499,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[32]={['Alpha']=1,['Y']=15359,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1068,['EffectType']=8502,['Yaw']=3.839724,['Z']=100349.259994,['MetaData']={['title']='2E 565 Part 15',['message']='A cool breeze drifted in from the sea. Even in the summer Wrothgar was never more than tolerably cold. She had grown to like it. Her memories of Valenwood were warm and damp, the air on a hot day thick and heavy and sticky. This was better.\\n\\nShe stuffed the last bit of steamed bun into her mouth and kicked her legs out over the edge, slumping forward with a sigh. She chewed as she stared out over the endless black sea. She kept replaying the moment she locked eyes with Lugdub, wondering what woke him, and what stupid thoughts had passed through his little pea brain as he stared down at her. \\n\\nShogrul was right. It didn\\'t matter. He wasn\\'t worth it. But it felt good to feel his face crack under her boot.\\n\\nThen she thought of Lugdub\\'s hateful orc face, twisted in anger as he spat \"Go home, *knife-ear*,\" and she scowled. Her breath quickened and she pressed her forehead into the heels of her hands, hot tears brimming in her eyes. She blinked hard and they fell. They left three little dark spots on her trousers. She felt her ears with her fingertips, not particularly long, but pointed at the tip, and wished she could fold them down to match the orcs.\\n\\nThe sound of the river and the falls behind her were like a wall between her and the rest of the clan. The rushing water was so loud she didn\\'t hear Revyn before he sat down beside her. She spared him a short glance over her shoulder then sniffed and wiped her face on her sleeve. She brought her knees to her chest and hugged them tight, and looked back to the sea as though he wasn\\'t there.\\n\\nHe put his legs over the edge and rested his elbows on them without looking at her. They sat like that for a while, just watching the waves and the sky as it grew darker.',},['Contrast']=1,['X']=71124.929166,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},[33]={['Alpha']=1,['Y']=15359,['SizeY']=30,['Roll']=0,['Pitch']=4.712564,['Id']=1069,['EffectType']=8502,['Yaw']=3.839724,['Z']=100300.679887,['MetaData']={['title']='2E 565 Part 16',['message']='\"I used to sit up here for hours,\" Irliah said hoarsely, still looking out over the water, her cheek resting on her knees. She shrugged, \"I thought maybe one day I\\'d see a boat I didn\\'t know, and my father would be there, coming to take me home.\" She gave a disdainful laugh. \"I don\\'t even know where \\'home\\' is.\"\\n\\nRevyn\\'s brow creased but a slight smile tugged at the corner of his lips. \"I remember that. I\\'d always wondered how you climbed up here by yourself.\" Irliah hugged her legs tighter. She felt tears tickling the bridge of her nose and was determined not to let Revyn see. He was there when Lugdub said it and nearly started a fight on the spot. She knew how angry it made him.\\n\\n\"I just wanted to... I wanted to bring something back to the clan. To prove I belong here,\" she said. \"It\\'s just a stupid axe. And now Lugdub gets to be right and I\\'m just a silly little elf, playing at being an orc.\"\\n\\nHe was quiet again. She heard voices from the village as the clan gathered around their fires to drink and tell stories, muffled by the rush of the river and the sea below. \\n\\n\"You\\'ll be alright tomorrow,\" Revyn said at last, \"and if you don\\'t know where home is I can walk you there myself.\"\\n\\nAfter a pause, annoyed, she looked up at him and couldn\\'t help but laugh at his stupid grin. She smiled and punched his arm softly. \\n\\nHe leaned back and rubbed the spot dramatically. \"Oof, that\\'s not gonna do you any good against Slugdub.\"\\n\\n\"Shut up.\" She sniffed.\\n\\nHe stood and held out his hand. \"Come on,\" he nodded towards the longhouse. \"Ren\\'s reading Vehk\\'s sermons and needs an audience.\"\\n\\nIrliah wrinkled her nose but let him pull her up. They walked back together. She fell asleep curled up in her bed, holding the stuffed snow bear Brelyna made for her.\\n\\nShe dreamt of a forest of bones.',},['Contrast']=1,['X']=71089.715913,['Groups']=0,['SizeX']=26.456456,['Color']=102439,['SizeZ']=30,},},}"
