R["fx__na__@kjoricwabi__47"]="{['Effects']={[1]={['SizeZ']=3600,['Y']=36861,['SizeX']=4400,['Color']=101110,['Alpha']=0.940000,['Roll']=0,['Groups']=0,['Z']=87351,['Yaw']=1.570796,['X']=79749,['SizeY']=3600,['Contrast']=0.880000,['Pitch']=1.570971,['Id']=1212,['EffectType']=910,},[2]={['SizeZ']=600,['Y']=35664,['SizeX']=600,['Color']=999999,['Alpha']=1,['Roll']=0,['Groups']=0,['Z']=87448,['Yaw']=4.712389,['X']=75185,['SizeY']=600,['Contrast']=1,['Pitch']=0,['Id']=1233,['EffectType']=4499,},[3]={['Pitch']=1.658063,['Y']=37048,['Contrast']=1,['MetaData']={['title']='The Vault',['message']='Introduction\\nThis is the testament of the four guardians of the treasure: Enrienendor Thilinour, Arieninturco Laraethihre,  Hidonniss Larethifeth and Sinar Athoth. \\nWe are, or were, mystics of the Psijic Order. Our task was simple, locate powerful artifacts and bring them to Artaeum for safekeeping. \\n\\nThe treasure\\nAmong the artifacts, there was Aetherium, lots of it. Neither mer nor men remember how to use such power. The secret was lost with the Dwemer. \\n\\nThe incident\\nIt all happended in the Hiding of Artaeum. We miscalulated how the power of Aetherium would disrupt the process. \\nWe had no choice but to severe the vault from the island thus getting stranded half way in some lost pocket of Oblivion. \\n\\nAt first, we did not know where he had landed. But it didn\\'t take long util we discovered that Molag Bal was lord in this realm. \\n\\nOur options were limited. Our conection to Artaeum is lost, we can not get back while the island is hidden. \\nWe, alone, do not have the power to port back to Mundus. Not unseen, not fast enough. If Molag Bal discovers this vault, he will get great source of power.  \\nThus, we decided to protect the treassure and bid our time. We detatched this piece of rock and placed wards around it to hide it. In so doing, we stretched our powers to the limit, and just our ancestors, we had to give our very flesh in the process. \\nOur spirits linger in four towers until the Psijics return to claim their own. \\n                                   (Sinar Athoth, Mystic.)',},['Color']=102439,['SizeZ']=30,['Roll']=0,['Groups']=0,['Alpha']=1,['Yaw']=4.712389,['X']=85162,['SizeY']=30,['Z']=90671,['SizeX']=26.456456,['Id']=1237,['EffectType']=8501,},[4]={['Pitch']=4.799655,['Y']=36868,['Contrast']=1,['MetaData']={['title']='Anonymous Journal',['message']='I don\\'t know how I got dragged here. \\nCan\\'t get out, can\\'t get in! \\nI don\\'t know where I am, but this not Tamriel. One instant I was camping in Grathwood, the other I am here. \\nI seached the place for a way out but there is none. This is a island floating in the void. \\nThere is something in the middle, but it is protected by magic. The door can\\'t be opened. I think the towers are the key. They have some inscriptions but I can\\'t read them. I guess it would take a wizzard to understand them. ',},['Color']=82135,['SizeZ']=30,['Roll']=0,['Groups']=0,['Alpha']=1,['Yaw']=3.141593,['X']=78584,['SizeY']=30,['Z']=89374,['SizeX']=26.456456,['Id']=1254,['EffectType']=8501,},[5]={['SizeZ']=1000,['Y']=37232,['SizeX']=800,['Color']=999999,['Alpha']=1,['Roll']=0,['Groups']=0,['Z']=90798,['Yaw']=1.570796,['X']=82706,['SizeY']=1000,['Contrast']=1,['Pitch']=0,['Id']=1255,['EffectType']=4499,},[6]={['Pitch']=0,['Y']=37030,['Contrast']=1,['MetaData']={['message']='If you are a true mage, snap your fingers and burst a flame. ',},['Color']=9999,['SizeZ']=100,['Roll']=0,['Groups']=0,['Alpha']=1,['Yaw']=3.141593,['X']=83592,['SizeY']=100,['Z']=100585,['SizeX']=100,['Id']=1256,['EffectType']=872,},[7]={['Pitch']=0,['Y']=37182,['Contrast']=1,['MetaData']={['message']='Use the Gryphon Talisman on this tower.',},['Color']=9999,['SizeZ']=100,['Roll']=0,['Groups']=0,['Alpha']=1,['Yaw']=4.712389,['X']=94074,['SizeY']=100,['Z']=91284,['SizeX']=100,['Id']=1257,['EffectType']=872,},[8]={['Pitch']=0,['Y']=37092,['Contrast']=1,['MetaData']={['message']='Vanus ...',},['Colo