R["oh__@hiddenmoon"]="{['Key']='oh__@hiddenmoon',['eu']={[49]={['O']=18928,['C']=1.038000,['D']='A little house in the swamp. They say you hear eerie noises at night. It is said that some never returned. This little house may be hiding some secrets.',['N']='Hexenhäuschen',},[66]={['O']=18885,['C']=1.007000,['D']='The former Elinhir Arena was abandoned for a long time and only a ruin. However the Trimerius family bought this ruin, had it restored and converted into an amphittheatre at the same time. If there is no performance then the public can watch the actors rehearsing.',['N']='Kargstein-Arena',},[27]={['O']=18885,['C']=1.007000,['D']='This property is one of the summer houses of the Trimerius family. The house stood empty for a long time before the family bought it. They renovated the mansion and opened the garden to the public. the mansion itself remains private.',['N']='Arenthia Mansion',},[46]={['O']=18885,['N']='Kvatch Mansion',['D']='This is one of the summer residences of the Trimerius family. They acquired this property from an impoverished imperial nobleman who, due to the fall of the empire, could no longer finance it. \\n\\nThe family made a lot of changes and after that they opened the garden to the public. They keep the main house and the servants\\' house private.',['C']=1.007000,},[26]={['O']=18885,['N']='Domus Phrasticus',['D']='This cute little house is the tailoring shop of Letizia Trimerius. She always ensures that only exclusive fabrics and extraordinary patterns are used for the high quality clothing. The tailoring business here in Craglorn has many high-profile wealthy customers.',['C']=1.007000,},},['Version']=1762,['TS']=1635404201,}"
