R["oh__@cloudrest"]="{['Key']='oh__@cloudrest',['na']={[89]={['O']=18867,['N']='Fort Miremoth',['D']='At a strategic vantage in the lower Nibenay near the borders of Elsweyr and Blackwood, Fort Miremoth was abandoned by the Empire after the Soulburst tore though Tamriel.\\n\\nQuickly occupied by the forces of the Aldmeri Dominion, it now guards the northeastern approaches into Aldmeri territories from the Heartlands. Complete with magical wards, the Fort is a lucrative prize for the Pact, who have failed to take it.\\n\\nRumour has it, Miremoth is now home to an Elder Scroll, courtesy of the Thalmor.',['C']=1.007000,},[91]={['O']=18916,['N']='Dawnbrook Chateau',['D']='',['C']=1.007000,},[63]={['O']=19054,['N']='Alinorian Penthouse',['D']='[INTERIOR ONLY] - an expansive Penthouse Suite in the sprawling capital of High Elven civilization, Alinor. Complete with all the complements a Kinlord or Kinlady could wish for, done in the opulence of the Aldmeri.',['C']=1.007000,},},['TS']=1646273192,['Version']=1767,}"
